import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import { CVsContextProvider } from '/context/CVContext'

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <CVsContextProvider>
      <App />
    </CVsContextProvider>
  </React.StrictMode>
);
